import React from 'react'
import myPic from './sd.jpg';


const About = () => {

    const style ={
        middle:{
          minHeight: "calc(100vh - 100px)",
          padding: "10px"
        }
    }
    return (
        <div className="container">
          <div className="row">
            <div className="col-md-3 mx-23">
              <img src={myPic} alt="Profile" className="img-fluid rounded-circle" />
            </div>
            <div className="col-md-6">
              <h2>About Me</h2>
              <p>
                I am Hashir Iqbal, a Software Engineering student at NUST. I am a web and app developer, passionate about creating innovative solutions. In my free time, I enjoy playing cricket and painting.
              </p>
            </div>
          </div>
        </div>
      );
}

export default About
